            City
            <div>
              <Link to="/main">Ir a Main</Link>
            </div>
          </Route>
          <Route>
              Not Found
              <div>
          <Link to="/main">Ir a Main</Link>
        </div>
              </Route>
        </Switch>
      </Router>
    </div>
  );
};

